          // Important! Always set the container height explicitly
      <div style={{ height: '50vh', width: '100%' }}>
      <GoogleMapReact
        // bootstrapURLKeys={{ key: /* YOUR KEY HERE */ }}
        defaultCenter={{  lat: 59.95,
        lng: 30.33}}
        defaultZoom={11}
      >
